import React from 'react';

import './listItem.css';

const ListItem = (props) => {
    return (
        <div className="item">
            <div className="item-left">
                <div className="item-image">
                    <img src={`https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/${props.id}.png`} alt="Logo" />
                </div>
                <div className="item-value">
                    <p className="value">{props.name} <br /><small>{`Owned: ${props.owned}`}</small></p>
                </div>
            </div>
            <div className="item-right">
                <Link to={`/pokemon/${props.from}/${props.id}`}>Details</Link>
            </div>
        </div>
    )
}

export default ListItem;
